import React from 'react';

interface Testimonial {
  quote: string;
  author: string;
  role: string;
  company: string;
  location: string;
  avatar: string;
}

const TestimonialsSection: React.FC = () => {
  const testimonials: Testimonial[] = [
    {
      quote: "The right partner for your online training. As a project manager, I've dealt with too many vendors who promise the world and they don't deliver. But Techademy delivers exactly what they advertise, on time and at a great price for the value delivered at its best.",
      author: "Ben Johnson",
      role: "",
      company: "",
      location: "United States",
      avatar: "BJ"
    },
    {
      quote: "Worth every hour and every dollar invested. Great course! Techademy showed me how to use AI tools in my daily project management work. Now I'm using ChatGPT for meeting summaries and other AI tools for scheduling. Its a Very practical approach.",
      author: "Harry",
      role: "",
      company: "",
      location: "United States",
      avatar: "H"
    },
    {
      quote: "Helped me apply AI to my work the very next day. Very Useful Prompts & Tools. The prompts & tools that you get with the program have been very useful in my day-to-day PM responsibilities. I've been able to generate project briefs, meeting agendas & status reports in a fraction of the time it used to take.",
      author: "Morgan H",
      role: "",
      company: "",
      location: "United States",
      avatar: "MH"
    },
    {
      quote: "Finally, a training provider that actually delivers. Techademy's course on AI for Product Managers provided exactly what I needed - practical frameworks for implementing AI features without getting lost in technical jargon. The case studies were particularly valuable.",
      author: "Brody Jay",
      role: "",
      company: "",
      location: "United States",
      avatar: "BJ"
    },
    {
      quote: "Practical AI Skills I Could Use Immediately. As a traditional PM, I was skeptical about AI but this Techademy course changed my perspective completely. The trainers explained everything in simple terms and gave real examples. I'm now implementing AI solutions in my projects.",
      author: "Beatrice",
      role: "",
      company: "",
      location: "United States",
      avatar: "B"
    },
    {
      quote: "Outstanding Material! With limited knowledge on the subject, Techademy's AI for Project Managers course equipped me with everything I needed to confidently spearhead AI implementation projects. Seeing how valuable the risk assessment templates were, made the entire course investment worthwhile.",
      author: "Hendrix Jay",
      role: "",
      company: "",
      location: "United States",
      avatar: "HJ"
    },
    {
      quote: "This program completely shifted my perspective. The Gen AI for Project Managers program transformed my approach to project leadership. I've implemented AI tools across our workflows, resulting in more accurate estimations, streamlined resource allocation, and enhanced team productivity.",
      author: "Ezra",
      role: "",
      company: "",
      location: "United States",
      avatar: "E"
    },
    {
      quote: "The workshop gave me confidence with AI! This is really an Excellent course! Techademy helped me understand how to integrate AI features into our products. The case studies were really insightful and applicable to my work in day-to-day responsibilities.",
      author: "Joshua",
      role: "",
      company: "",
      location: "United States",
      avatar: "J"
    }
  ];

  return (
    <section className="py-20 bg-black relative overflow-hidden">
      {/* Noise pattern overlay */}
      <div className="absolute inset-0 opacity-20">
        <svg className="w-full h-full" xmlns="http://www.w3.org/2000/svg">
          <filter id="noise">
            <feTurbulence type="fractalNoise" baseFrequency="0.85" numOctaves="4" stitchTiles="stitch"/>
            <feColorMatrix type="saturate" values="0"/>
          </filter>
          <rect width="100%" height="100%" filter="url(#noise)"/>
        </svg>
      </div>

      <div className="max-w-7xl mx-auto px-6 relative z-10">
        <div className="text-center mb-16">
          <div className="inline-flex items-center gap-2 bg-gray-800 text-gray-300 px-4 py-2 rounded-full text-sm mb-6">
            <span className="text-orange-500">✦</span>
            Success Stories
          </div>
          <h2 className="text-3xl font-normal text-white mb-6">
            Hear from Professionals Who've Attended This Session
          </h2>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
          {testimonials.map((testimonial, index) => (
            <div 
              key={index}
              className="bg-white/5 backdrop-blur-sm rounded-2xl p-8 border border-white/10 hover:border-white/20 transition-all duration-300 hover:shadow-xl"
            >
              <div className="mb-6">
                <svg className="w-10 h-10 text-orange-500 mb-4" fill="currentColor" viewBox="0 0 20 20">
                  <path fillRule="evenodd" d="M3 17a1 1 0 011-1h12a1 1 0 110 2H4a1 1 0 01-1-1zM6.293 6.707a1 1 0 010-1.414l3-3a1 1 0 011.414 0l3 3a1 1 0 01-1.414 1.414L11 5.414V13a1 1 0 11-2 0V5.414L7.707 6.707a1 1 0 01-1.414 0z" clipRule="evenodd" />
                </svg>
              </div>

              <blockquote className="text-lg text-gray-300 leading-relaxed mb-6 italic">
                "{testimonial.quote}"
              </blockquote>

              <div className="flex items-center">
                <div className="w-12 h-12 bg-gradient-to-r from-orange-500 to-red-500 rounded-full flex items-center justify-center text-white font-bold mr-4">
                  {testimonial.avatar}
                </div>
                <div>
                  <div className="font-medium text-white">{testimonial.author}</div>
                  <div className="text-sm text-gray-400">
                    {testimonial.location}
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default TestimonialsSection;
